function Navbarend({openSettings}){

    const [anchorEl, setAnchorEl] = useState(null);
    const open = Boolean(anchorEl);
    const handleClick = (event) => {
    setAnchorEl(event.currentTarget);
     };

    const handleClose = () => {
    setAnchorEl(null);
      };
     const [appopen, setappOpen] = useState(false);
  const menuRef = useRef();

  const toggleMenu = () => setappOpen(!appopen);

  useEffect(() => {
    const handleClickOutside = (event) => {
      if (menuRef.current && !menuRef.current.contains(event.target)) {
        setappOpen(false);
      }
    };
    document.addEventListener("mousedown", handleClickOutside);
    return () => document.removeEventListener("mousedown", handleClickOutside);
  }, []);
  const openSettingsHandler=()=>{
    openSettings()
  }
  // help snackbar state + timer
  const [helpOpen, setHelpOpen] = useState(false);
  const helpTimerRef = useRef(null);

  const handleHelpClick = () => {
    handleClose();
    setHelpOpen(true);
    if (helpTimerRef.current) clearTimeout(helpTimerRef.current);
    helpTimerRef.current = setTimeout(() => {
      setHelpOpen(false);
      
    }, 2000);
  };

  useEffect(() => {
    return () => {
      if (helpTimerRef.current) clearTimeout(helpTimerRef.current);
    };
  }, []);
    return(
      <div className="navbarend">
        <Tooltip title="Support" placement='bottom'>
            <HelpOutlineOutlinedIcon className='contactsupporticon' variant="contained" onClick={handleClick} />
        </Tooltip>
        <Menu anchorEl={anchorEl} open={open} onClose={handleClose} anchorOrigin={{ vertical: "bottom", horizontal: "right" }} transformOrigin={{ vertical: "top", horizontal: "right" }}>
            <MenuItem onClick={handleHelpClick}>Help</MenuItem>
            <MenuItem>Training</MenuItem>
            <Divider/>
            <MenuItem >Send feedback to Google</MenuItem>
        </Menu>
        <Snackbar
          open={helpOpen}
          anchorOrigin={{ vertical: 'bottom', horizontal: 'left' }}
          message="Opening settings..."
          autoHideDuration={2000}
          onClose={() => setHelpOpen(false)}
        />
        <div>        
          <Tooltip title="Settings" placement='bottom'>
            <SettingsOutlinedIcon className='settingsicon' onClick={openSettingsHandler} />
          </Tooltip>
          {/* <QuickSettingsDrawer/> */}
        </div>

        <Tooltip title="Try Gemini" placement='bottom'>
            <AutoAwesomeIcon className='geminiicon' />
        </Tooltip>
        <div ref={menuRef}>
            <Tooltip title="Google apps" placement='bottom'>
                <AppsRoundedIcon className='appmenuicon' onClick={toggleMenu}/>
            </Tooltip>
        
            {appopen && (
            <div className='google-apps'
              style={{
                position: "absolute",
                top: "50px",
                right: "20px",
                width: 320,
                padding: 16,
                backgroundColor: "#fff",
                borderRadius: 16,
                boxShadow: "0 4px 12px rgba(0,0,0,0.15)",
                display: "grid",
                gridTemplateColumns: "repeat(3, 1fr)",
                gap: 16,
                zIndex: 1000,
              }}>
              {apps.map((app, index) => (
                <div key={index} onClick={() => setappOpen(false)} style={{display: "flex", flexDirection: "column", alignItems: "center", cursor: "pointer", textAlign: "center",}}>
                  <img src={app.icon} alt={app.name} style={{ width: 40, height: 40, marginBottom: 8 }}/>
                  <span style={{ fontSize: 14 }}>{app.name}</span>
                  
                </div>
              ))}<br/>
              <a className='more-for-google' href='https://about.google/products/'>
                <Button  variant="outlined">More from Google</Button>
              </a>
            </div>
          )}
        </div>
            <div>
              <Googleaccount/>
            </div>

      </div>
      
    )
}

